// Equipements.jsx
import CollapseItem from "../../components/Collapse/Collapse";

function Equipements({ logementId, data }) {
  // Recherche du logement correspondant dans les données
  const logement = data.find((log) => log.id === logementId);

  if (!logement) {
    return <div>Logement non trouvé</div>;
  }

  const { equipments } = logement;

  return (
    <div>
      <CollapseItem>
        {equipments && equipments.length > 0 ? (
          <ul>
            {equipments.map((equipment, index) => (
              <li key={index}>{equipment}</li>
            ))}
          </ul>
        ) : (
          <p>Aucun équipement disponible</p>
        )}
      </CollapseItem>
    </div>
  );
}

export default Equipements;
